export const CHANGE_MODE = "CHANGE_MODE";
export const CHANGE_LAN = "CHANGE_LAN";

export function changeMode() {
  return async function (dispatch) {
    try {
      return dispatch({
        type: CHANGE_MODE,
      });
    } catch (error) {
      return error.message;
    }
  };
}

export function changeLan() {
  return async function (dispatch) {
    try {
      return dispatch({
        type: CHANGE_LAN,
      });
    } catch (error) {
      return error.message;
    }
  };
}
